import React, { Component } from 'react';

class MenuComponent extends Component {
    constructor(props) {
        super(props);

    }


    redirectStudents(){
        this.props.history.push("/students");
    }

    redirectGroups(){
        this.props.history.push("/groups");
    }

    redirectJournal(){
        this.props.history.push("/journal");
    }

    render() {
        return (
            <div>
               <div className="my-5 px-4" style={{backgroundColor:"RGBA(170,180,0,.7)"}}>
                   <a>Список журналов</a><br/>
                   <a>Список студентов</a><br/>
                   <a>Список групп</a>
               </div>
            </div>
        );
    }
}


export default MenuComponent;
